interface Props{
    visible: boolean;
    score: number;
    correctQuestions:number;
    questionLength:number | undefined;
}
export default function QuizResult(props: Props){
    const { visible, score, correctQuestions, questionLength } = props
    return (
        <>
            {visible && 
                <div className="flex justify-center">
                     <div id="page-container" className="w-4/5 justify-center flex-col page-container">
                        <div className="text-3xl ">Your Score : {score}</div>
                        <div className="text-3xl text-center">You got  : {correctQuestions}/{questionLength}</div>
                    </div>
                </div>
            }
        </>
    )
}
